import React from 'react'
import styled from 'styled-components'

function Signup() {
  return (
    <Container>
        Welcome to Signup page
    </Container>
  )
}
const Container=styled.div`
    width:40%;
    min-width:450px;
    height:fit-content;
    padding:15px;
    margin:auto;
    display:flex;
    flex-direction:column;
    align-items:center;

`;

const Logo =styled.div`
    width:120px;
    margin-bottom:20px;

    img{
        width:100%;
    }

`;
export default Signup
